import React from 'react'
import "./footer.css"
import {FacebookIcon, TwitterIcon} from '@mui/icons-material/Facebook';

export default function Footer() {
    return (
        <div className="content">
            <FacebookIcon className="icon"/>
            <TwitterIcon className="icon"/>
            <li>facebook</li>
            <li>twitter</li>
            <li>Instagram</li>
            <li>gmail</li>
            Copyright 2021
        </div>
    )
}
